import React from 'react';
import TopNavigation from './components/top-navigation';
import LandingPage from './pages/landingpage';
import { BrowserRouter, Switch, Route } from 'react-router-dom';



function App() {
  return (
    <BrowserRouter>
    <TopNavigation/>
    <Switch>
      <Route exact path = '/'>
        <LandingPage />
      </Route>
      </Switch>
      </BrowserRouter>

  )
}

export default App;
